class Solution:
    """
    @param key: A String you should hash
    @param HASH_SIZE: An integer
    @return an integer
    """

    def hashCode(self, key, HASH_SIZE):
        length = len(key)
        value = 0
        for i in range(length, 0, -1):
            sub_value = ord(key[length - i]) * (33 ** (i - 1))
            value += sub_value
        return value % HASH_SIZE


key = ""
hs = 1000007
x = Solution()
print(x.hashCode(key, hs))
